import React from 'react';
import ReactDOM from 'react-dom';
import Head from 'next/head'

class Map extends React.Component {

  componentDidMount() 
  {
    this.initMap();
  }

  initMap()
  {
    let pos = this.initialPosition

    this.map = new google.maps.Map(document.getElementById('map'), {
      center: pos,
      zoom: 15,
      mapTypeControl: false,
      fullscreenControl: false,
    });
  }

  async initialPosition()
  {
    let pos = {lat:4.603843 , lng: -74.062705};
    let ip = await fetch('https://api.ipify.org').then(response=>response.text()); 
    pos = await fetch('https://api.ipgeolocation.io/ipgeo?apiKey=02ff42e6f29c453e8d60df6139f5f9ed&ip='+ip).then(response=>response.json());
    return {lat:parseFloat(pos.latitude), lng:parseFloat(pos.longitude)};
  }


  render () {
    var customStyle = {
      padding:"0",
      margin:"0",
      display: 'block',
      height: '97vh',

      background:'WhiteSmoke'
    }

    return (
      <div>
        <Head>
          <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyBt0ZCE1kAklBJiBnCYGX6kl0tglLcKlLI"></script>
        </Head>
        <div id="map" style={customStyle}>Cargando...</div>
      </div>
    )
  }
}

export default Map
